import React from 'react'
import Svg from './Svg'
export const SvgPicture = ({size, title, desc, titleId, descId, ...props}) => (
  <Svg
    viewBox="0 0 24 24"
    height={size}
    width={size}
    fill="currentcolor"
    {...props}
  >
    {!!title && <title id={titleId}>{title}</title>}
    {!!desc && <desc id={descId}>{desc}</desc>}
    <path d="M21 19V5c0-1.1-.9-2-2-2H5c-1.1 0-2 .9-2 2v14c0 1.1.9 2 2 2h14c1.1 0 2-.9 2-2zM8.5 13.5l2.5 3 3.5-4.5 4.5 6H5l3.5-4.5z" />
  </Svg>
)
SvgPicture.isIcon = true
SvgPicture.defaultProps = {
  size: 24,
  'aria-hidden': 'true',
  focusable: 'false',
  tabIndex: '-1'
}
export default SvgPicture
